crde nicht in den Himmel kommen, weil der Atheist war. Und der Papst hat den Kleinen versichert, dass Gott den Papa sicher bei sich haben w\u00fcrde","id":"444203164682420225","timestamp":"2018-05-10T18:24:47.356000+00:00","s":58358,"edited_timestamp":null,"embeds":[],"attachments":[],"author":35,"mentions":[]},{"content":"Ich erinner mich auch gerade an die muslimische Familie die seit hunderten von Jahren den Schl\u00fcssel zu einer gro\u00dfen christlichen Kirche in Jerusalem aufbewahrt","id":"444203357406625804","timestamp":"2018-05-10T18:25:33.305000+00:00","s":58359,"edited_timestamp":null,"embeds":[],"attachments":[],"author":35,"mentions":[]},{"content":"Jeden Morgen schlie\u00dft der Bewahrer die Kirche auf, und jeden Abend wieder zu","id":"444203417288704010","timestamp":"2018-05-10T18:25:47.582000+00:00","s":58360,"edited_timestamp":null,"embeds":[],"attachments":[],"author":35,"mentions":[]},{"content":"Sowas, also echte Taten die Liebe, Zusammenhalt und Einheit ausdr\u00fccken f\u00e4nd ich besser als Zitate, weil das sind eben nur Zitate, die gegen andere Zitate gestellt werden k\u00f6nnen","id":"444203591910031360","timestamp":"2018-05-10T18:26:29.215000+00:00","s":58361,"edited_timestamp":null,"embeds":[],"attachments":[],"author":35,"mentions":[]},{"content":"Bin noch neu. Wie ist es mit Memes von Pinterest, Google oder Tumblr, teilt und verwendet ihr die hier auch? Es gibt doch auch schon viele Memes, die man weiter verbreiten k\u00f6nnte.","id":"444204103866777613","timestamp":"2018-05-10T18:28:31.275000+00:00","s":58362,"edited_timestamp":null,"embeds":[],"attachments":[],"author":494,"mentions":[]},{"content":"Manchmal werden vorhandene Memes umgeschrieben und unser Zeichen wird reingesetzt","id":"444204277431533569","timestamp":"2018-05-10T18:29:12.656000+00:00","s":58363,"edited_timestamp":null,"embeds":[],"attachments":[],"reactions":[{"emoji":{"name":"\ud83d\udc4d"},"count":1}],"author":35,"mentions":[]},{"content":"und Hashtags","id":"44420 st. Die Absicht ist eine zweistufige Reaktion, die bei den Trollen ausgel\u00f6st werden soll: Stufe 1: \"Was soll der Quatsch?\" Stufe 2: \"Wer wird wem nichts tun?\". \r\n\r\nDas strategische Ziel des Memes (wie ist die Einzahl von Memes? Mem? Memo?) ist, Trolle mit der Erfahrung zu konfrontieren, sich wieder eigenst\u00e4ndig Gedanken \u00fcber etwas zu machen.","id":"444368778030088193","timestamp":"2018-05-11T05:22:52.655000+00:00","s":58432,"edited_timestamp":null,"embeds":[],"attachments":[{"width":800,"url":"https://cdn.discordapp.com/attachments/441253237132230656/444368778030088192/Spruch_Keine_Angst.jpg","size":72589,"proxy_url":"https://media.discordapp.net/attachments/441253237132230656/444368778030088192/Spruch_Keine_Angst.jpg","height":800}],"reactions":[{"emoji":{"name":"\ud83e\udd14"},"count":2},{"emoji":{"name":"\ud83d\udc4d"},"count":2}],"author":501,"mentions":[]},{"content":"Hier noch die Twitter-Version","id":"444372357033885710","timestamp":"2018-05-11T05:37:05.956000+00:00","s":58433,"edited_timestamp":null,"embeds":[],"attachments":[{"width":1080,"url":"https://cdn.discordapp.com/attachments/441253237132230656/444372357033885708/Spruch_Keine_Angst_-_Twitter_Version.jpg","size":72559,"proxy_url":"https://media.discordapp.net/attachments/441253237132230656/444372357033885708/Spruch_Keine_Angst_-_Twitter_Version.jpg","height":610}],"reactions":[{"emoji":{"name":"\ud83e\udd14"},"count":1}],"author":501,"mentions":[]},{"content":"Ihr solltet das Bild in so vielen Diskussionen wie m\u00f6glich posten, damit es richtig nervt. Um so mehr Gedanken machen sich die Trolle dar\u00fcber.","id":"444373614905655316","timestamp":"2018-05-11T05:42:05.856000+00:00","s":58434,"edited_timestamp":null,"embeds":[],"attachments":[],"reactions":[{"emoji":{"name":"all_the_things"},"count":1}],"author":501,"mentions":[]},{"content":"\u003c@440064283036876801> finde ich super!\n\u003c@439173348916854795> ja! Viel besser! Sag mal, bist du NoFX-Fan? \ud83d\ude09","id":"
